import React from "react";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import "bootstrap/dist/css/bootstrap.css";
import "./App.css";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import CreateProduct from "./create-product.component";
import EditProduct from "./edit-product.component";
import ProductList from "./product-list.component";

function App() {
  return (
    <div className="App">
      <header>
        <nav className="navBar">
          <ul>
            <li>
              <NavLink exact to="/">
                CreateProduct
              </NavLink>
            </li>
            <li>
              <NavLink to="/create-product">CreateProduct</NavLink>
            </li>
            <li>
              <NavLink to="/product-list">ProductList</NavLink>
            </li>
          </ul>
        </nav>
      </header>

      <BrowserRouter>
        <div className="App">
          <Switch>
            <Route exact path="/" component={CreateProduct} />
            <Route path="/create-product" component={CreateProduct} />
            <Route path="/edit-product/:id" component={EditProduct} />
            <Route path="/product-list" component={ProductList} />
          </Switch>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
